import React, { PureComponent } from 'react'
import {Link} from 'react-router-dom'
import Logo from '../product-1.png'

class Navbar extends PureComponent {
    
    render() {
        return (
            
            <img src={Logo} alt="Home"> </img>
                  
        )
    }
}

export default Navbar
